package com.example.concesionario.dataset

import com.example.concesionario.model.Coche
import com.example.concesionario.model.Marca
import com.example.concesionario.model.Modelo

class Dataset {

    companion object {

        fun getListaModelos(marca: Marca): ArrayList<Modelo> {
            val listaModelos: ArrayList<Modelo> = arrayListOf()

            when (marca.nombre) {
                "Ford" -> {
                    listaModelos.add(Modelo(marca, "Focus"))
                    listaModelos.add(Modelo(marca, "Mondeo"))
                    listaModelos.add(Modelo(marca, "Kuga"))
                    listaModelos.add(Modelo(marca, "Mondeo"))
                }

                "Seat" -> {
                    listaModelos.add(Modelo(marca, "Ibiza"))
                    listaModelos.add(Modelo(marca, "Arona"))
                    listaModelos.add(Modelo(marca, "Panda"))
                    listaModelos.add(Modelo(marca, "Ateca"))
                }

                "Mercedes" -> {
                    listaModelos.add(Modelo(marca, "Clase A"))
                    listaModelos.add(Modelo(marca, "Clase E"))
                    listaModelos.add(Modelo(marca, "Clase C"))
                    listaModelos.add(Modelo(marca, "Clase S"))
                }

                "Audi" -> {
                    listaModelos.add(Modelo(marca, "e tron"))
                    listaModelos.add(Modelo(marca, "A3"))
                    listaModelos.add(Modelo(marca, "A4"))
                    listaModelos.add(Modelo(marca, "A5"))
                }
            }

            return listaModelos
        }

        fun getModelo(modelo: Modelo): ArrayList<Coche> {
            val listaFiltrada: ArrayList<Coche> = arrayListOf()
            when (modelo.modelo) {

                "Fiesta" -> {
                    listaFiltrada.add(
                        Coche(modelo.marca,
                            "Fiesta ST",
                            20000,
                            150,
                            "data:image/jpeg;base64,", "Detalles del Fiesta ST"),
                    )
                    listaFiltrada.add(
                        Coche(
                            modelo.marca,
                            "Fiesta basic",
                            15000,
                            100,
                            "data:image/jpeg;base64,",
                            "Detalle Fiesta Basic"
                        )
                    )
                }

                "Focus" -> {
                    listaFiltrada.add(
                        Coche(modelo.marca,
                            "Focus ST",
                            40000,
                            180,
                            "https://fotos.quecochemecompro.com/ford-focus-st/ford-focus-st-verde-en-movimiento.jpg?size=750x400",
                            "Detalles del Focus ST"),
                    )
                    listaFiltrada.add(
                        Coche(
                            modelo.marca,
                            "Focusbasic",
                            20000,
                            120,
                            "data:image/jpeg;base64,",
                            "Detalles del Focus basic"
                        )
                    )
                }

                "Kuga" -> {}
                "Mondeo" -> {}

                "Clase A" -> {
                    listaFiltrada.add(
                        Coche(
                            modelo.marca,
                            "Clase A Amg",
                            50000,
                            350,
                            "data:image/jpeg;base64,",
                            "Detalles del Clase A Amg"
                        ),
                    )
                    listaFiltrada.add(
                        Coche(
                            modelo.marca,
                            "Clase A ",
                            30000,
                            140,
                            "data:image/jpeg;base64,",
                            "Detalles del Clase E Amg"
                        )
                    )
                }

                "Clase C" -> {}
                "Clase S" -> {}
                "Clase E" -> {
                    listaFiltrada.add(
                        Coche(
                            modelo.marca,
                            "Clase E Amg",
                            70000,
                            550,
                            "data:image/jpeg;base64,",
                            "Detalles del Clase A Amg"
                        ),
                    )
                    listaFiltrada.add(
                        Coche(
                            modelo.marca,
                            "Clase E ",
                            40000,
                            250,
                            "data:image/jpeg;base64,",
                            "Detalles del Clase E Amg"
                        )
                    )
                }
            }
            return listaFiltrada
        }


    }
}